class Mod_SaSuperSport_Base {
public:
    static const int SCORE_RACE = 0;
    static const int RANK_RACE = 1;
    static const int SUCCESS = 2;
};

void sxd_client::sa_super_sport() {
    for (;;) {
        // race info
        Json::Value data = this->Mod_SaSuperSport_Base_race_info();
        if (data[1].asInt() == 0)
            return;
        std::vector<Json::Value> player_list;
        std::copy(data[4].begin(), data[4].end(), std::back_inserter(player_list));
        std::sort(player_list.begin(), player_list.end(), [](const Json::Value& x, const Json::Value& y) {return x[5].asInt()<y[5].asInt();});

        // challage
        data = this->Mod_SaSuperSport_Base_challage(player_list[0][1].asInt(), player_list[0][8].asInt());
        if (data[0].asInt() != Mod_SaSuperSport_Base::SUCCESS) {
            common::log(boost::str(boost::format("【圣域竞技场】挑战失败，result[%1%]") % data[0]), iEdit);
            return;
        }
        std::vector<std::string> items;
        items.push_back(boost::str(boost::format("[积分%+d]") % data[3]));
        std::transform(data[2].begin(), data[2].end(), std::back_inserter(items), [this](const Json::Value& x) {
            return boost::str(boost::format("[%1%×%2%]") % db.get_code(version, "Item", x[0].asInt())["text"] % x[1]);
        });
        if (data[3].asInt() > 0)
            common::log(boost::str(boost::format("【圣域竞技场】挑战 [%1%(%2%)]，战胜！获得：%3%") % common::utf2gbk(player_list[0][4].asString()) % player_list[0][5] % boost::algorithm::join(items, "，")), iEdit);
        else
            common::log(boost::str(boost::format("【圣域竞技场】挑战 [%1%(%2%)]，战败！获得：%3%") % common::utf2gbk(player_list[0][4].asString()) % player_list[0][5] % boost::algorithm::join(items, "，")), iEdit);
    }

}

